import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
   Card, CardTitle, Col, Row,CardText
} from 'reactstrap';


export default function Resultado(props) {

    return (

        <Row>
            <Col sm="6">
                {props.result.filter((v) => v.valor)}


            </Col>
        </Row>
    );
}
